import React, { Component } from 'react';
import { Switch, Route, Link } from 'react-router-dom'
import LanguageSelector from '../../components/language-selector/language-selector.js';
import PolicyLinks from '../../components/policy-links/policy-links.js';

import './footer.css';


class Footer extends Component {

  render() {

    return (
      <div className="footer__container">
        <div className="footer__left-section">
          <img src="/assets/logo-cci.svg" alt="Circle CI Logo" />
          <LanguageSelector />
        </div>
        <PolicyLinks />
      </div>  
    );
  } 
}


export default Footer;
